def solution(input_string):
    N, K = map( int, input().split() )
    if K > (N * (N + 1) // 2):
        return -1
    matrix = []
    for i in range(N):
        row = [0] * N
        for j in range(N):
            if i == j:
                row[j] = 1
            elif i < j:
                row[j] = K - (i * (i + 1) // 2) - (j - i - 1)
            else:
                row[j] = 0
            if row[j] < 0:
                return -1
            K -= row[j]
        matrix.append(row)
    for i in range(N-1):
        for j in range(i+1, N):
            matrix[j][i] = matrix[i][j]
    return matrix

