    visited=[False]*(n+1)
    visited[s]=True
    queue=[]
    queue.append(s)
    d=[0]*(n+1
    d[s]=0
    while queue:
        u=queue.pop(0)
        for i in range(m):
            if graph[i][0]==u and not visited[graph[i][1]]:
                visited[graph[i][1]]=True
                queue.append(graph[i][1])
                d[graph[i][1]]=d[u]+1
                if graph[i][1]==t:
                    return d[graph[i][1]
    return -1

