def solution(input_string):
    H,W=map(int,input().split())
    grid=[]
    for i in range(H):
        grid.append(list(input()))
    start=goal=0
    # Find the starting and ending positions
    for i in range(H):
        for j in range(W):
            if grid[i][j]=='.':
                start=i*W+j
                break
    for i in range(H-1,-1,-1):
        for j in range(W-1,-1,-1):
            if grid[i][j]=='.':
                goal=i*W+j
                break
    # BFS to find the distance from the start to all other squares
    visited=[False]*(H*W)
    visited[start]=True
    queue=[start]
    dist=[-1]*(H*W)
    dist[start]=0
    while queue:
        x=queue.pop(0)
        i=x//W
        j=x%W
        for dx,dy in [[-1,0],[1,0],[0,-1],[0,1]]:
            newi=i+dx
            newj=j+dy
            if 0<=newi<H and 0<=newj<W and grid[newi][newj]=='.' and not visited[newi*W+newj]:
                visited[newi*W+newj]=True
                dist[newi*W+newj]=dist[x]+1
                queue.append(newi*W+newj)
    return dist[goal]

