def mergesort(arr,l,r,count):
    if l>=r:
        return count
    mid=l+(r-l)//2
    count=mergesort(arr,l,mid,count)
    count=mergesort(arr,mid,r,count)
    i=l
    j=mid
    temp=[]
    while i<mid and j<r:
        if arr[i]<arr[j]:
            temp.append(arr[i])
            i+=1
        else:
            temp.append(arr[j])
            j+=1
    temp.extend(arr[i:mid])
    temp.extend(arr[j:r])
    arr[l:r]=temp
    return count+1

