    for i in range(3, n+1):
        tree[input_array[i]].append(i)
        tree[1].append(i)

    # Helper function to check if a node is an ancestor of another node
    def is_ancestor(node1, node2):
        if node1 == node2:
            return True
        for child in tree[node1]:
            if is_ancestor(child, node2):
                return True
        return False

    # DFS function to traverse the tree and count the number of valid subsets
    def count_valid_subsets(node, k):
        if len(tree[node]) == 0:
            return 1 if k == 0 else 0

        red_child_count = 0
        black_child_count = 0
        for child in tree[node]:
            if child in red_nodes:
                red_child_count += count_valid_subsets(child, k-1)
            else:
                black_child_count += count_valid_subsets(child, k)

        if k == 0:
            return red_child_count
        else:
            return (red_child_count * black_child_count) % (10**9+7)

    # Loop over all possible values of k and count the number of valid subsets for each
    result = []
    for k in range(m+1):
        result.append(count_valid_subsets(1, k))

