    digits = list(input_string)

    # Initialize a variable to store the number of valid subsets
    valid_subsets = 0

    # Iterate through the input string
    for i in range(len(digits)):
        # If the current digit is a zero, skip it
        if digits[i] == '0':
            continue
        # For each valid subset of digits, check if it is divisible by 3
        for j in range(i, len(digits)):
            subset = int(''.join(digits[i:j+1])
            if subset % 3 == 0:
                valid_subsets += 1

    # Return the result modulo 10^9 + 7
    return valid_subsets % (10**9 + 7)

