        elif op == '-':
            for num in range(1, n+1):
                if (num not in used) or (num - current_sum == t):
                    total += fill(positions[1:], used.copy(), num, current_product)
        elif op == '*':
            for num in range(1, n+1):
                if (num not in used) or (op == '*' and num * current_product == t):
                    total += fill(positions[1:], used.copy(), current_sum, current_product * num)
        elif op == '/':
            for num in range(1, n+1):
                if (num not in used) or (op == '/' and current_product % num == 0 and t == current_product // num):
                    total += fill(positions[1:], used.copy(), current_sum, current_product // num)
        else:
            return 0

        used.remove((row, col))
