def match(pattern, file):
    i = 0
    j = 0
    n = len(pattern)
    m = len(file)
    while i < n and j < m:
        if pattern[i] == '*':
            while i < n:
                if i+1 < n and pattern[i+1] == '*':
                    return match(pattern[i+2:], file[j:])
                if match(pattern[i+1:], file[j:]):
                    return True
                j += 1
        elif pattern[i] == file[j] or pattern[i] == '?':
            i += 1
            j += 1
        else:
            return False
    return i == n and j == m

