    witch_moves = []
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '#':
                witch_moves.append((i, j))

    def is_reachable(start, end, grid):
        if start == end:
            return True
        x, y = start
        dx, dy = end
        if x > dx:
            return False
        if y > dy:
            return False
        if x == dx and y < dy:
            return is_reachable((x, y+1), end, grid)
        elif x < dx and y == dy:
            return is_reachable((x+1, y), end, grid)
        else:
            return is_reachable((x+1, y+1), end, grid)

    min_reachable = n*m
    for move in witch_moves:
        min_reachable = min(min_reachable, is_reachable(move, (n-1, m-1), grid))

    return min_reachable

