def solution(input_string):
    n = int(input())
    edges = [tuple(map(int, line.split())) for line in input_string.split('\n')]
    # initialize adjacency list
    adj = [[] for i in range(n+1)]
    for u, v in edges:
        adj[u].append(v)
        adj[v].append(u)
    # BFS
    def bfs(start):
        queue = [start]
        visited = [False] * (n+1)
        visited[start] = True
        dist = [float('inf')] * (n+1)
        dist[start] = 0
        while queue:
            next_queue = []
            for u in queue:
                for v in adj[u]:
                    if not visited[v]:
                        visited[v] = True
                        dist[v] = dist[u] + 1
                        next_queue.append(v)
            queue = next_queue
        return dist
    # DFS
    def dfs(u, v, visited, pairs):
        if visited[u] or visited[v]:
            return
        visited[u] = visited[v] = True
        for w in adj[u]:
            if w != v and w != adj[u][-1]:
                pairs.append((u, w))
                dfs(w, adj[w][-1], visited, pairs)
        for w in adj[v]:
            if w != u and w != adj[v][-1]:
                pairs.append((v, w))
                dfs(w, adj[w][-1], visited, pairs)
    pairs = []
    dist = [bfs(1)]
    for i in range(2, n+1):
        dfs(i, adj[i][-1], [False] * (n+1), pairs)
    count = 0
    for pair in pairs:
        if (dist[pair[0]] + dist[pair[1]) % 2 == 0:
            count += 1
    return count % (10**9 + 7)

